    [],nt"revision_timestamp": "2016-07-27T22:20:47.483014",nt"name": "final-report-anadromous-fish-studies",nt"isopen":
    false,nt"url": null,nt"notes": "A creel census was conducted during the
    1981 Russian River sockeye salmon,  Oncorhynchus nerka (Walbaum), sport fishery
    to determine harvest and angler participation. Analysis of census data revealed
    51,030 man-days of angler effort were expended to harvest 34,440 sockeye salmon.
    Early and late runs contributed 10,720 and 23,720 salmon, respectively, to this
    harvest. Anglers caught 34.4 percent of the sockeye salmon to return to Russian
    River in 1981. Seasonal harvest per angler hour was 0.156.    Escapement of early
    and late run sockeye salmon were determined by weir located at the outlet of Lower
    Russian Lake. Early and late run 1981 escapements were 21,140 and 44,530 salmon,
    respectively. Early run escapement was 48.7 percent above the mean historical escapement
    and exceeded the minimum spawning escapement goal (9,000) by 12,140 fish. The late
    run escapement approximated the mean historical escapement (43,572) and exceeded
    the minimum spawning escapement goal (30,000) by 48.4 percent. An additional 4,160
    late run fish spawned below the weir in Lower Russian River. Total late run escapement
    was therefore 48,690 sockeye salmon. Total 1980 late run return (harvest plus escapement)
    was 17.7 percent of the Kenai River escapement.",nt"license_title": "License
